		public static int[] StringToInt(string x, int N) {
			string a = x;
			int[] result = new int[N];
			for (int i = 0; i < N; i++)
				result[i] = a[i] - 48;
			return result;
		}
		//-----------------------------------------------------------------------------------------------------
		public static int[] ShiftLeft(int[] s) {
			int[] x = s;
			for (int i = 0; i < x.Length - 1; i++) {
				x[i] = x[i + 1];
			}
			x[x.Length - 1] = 0;
			return x;
		}
