		//-----------------------------------------------------------------------------------------------------
		public static int[] Generate(int[] x) // добавляет единицу(или создает следующий вектор)
		{
			int[] temp = x;
			for (int i = temp.Length - 1; i >= 0; i--) {
				if (temp[i] == 1) {
					temp[i] = 0;
					continue;
				}
				if (temp[i] == 0) {
					temp[i] = 1;
					break;
				}
			}
			return temp;
		}
