		public static bool Check(int[] x, int[] y, int[] s, int[] z) {
			int n = x.Length;
			for (int i = 0; i < n; i++) {
				if (s[i] == 1) {
					if (z[i] != x[i]) {
						return false;
					} else continue;
				}
				if (s[i] == 0) {
					if (z[i] != y[i]) {
						return false;
					} else continue;
				}
			}
			return true;
		}
